const main=document.querySelector(".data"),rowsPerBlock=10,interval=8e3,createRow=(t,e)=>t[e]?`\n\t\t\t<tr class="table-row">\n\t\t\t\t<td>${t[e].first_name||""}</td>\n\t\t\t\t<td>${t[e].last_name||""}</td>\n\t\t\t\t<td>${t[e].borough||""}</td>\n\t\t\t\t<td>${t[e].pr||""}</td>\n\t\t\t\t<td>${t[e].goal||""}</td>\n\t\t\t</tr>\n\t\t`:"",renderItems=t=>{let e=0;const n=t.length,r=Math.ceil(n/10),a=n=>{n>=r&&(n=0,e=0);let o="";for(let n=0;n<10;n++)o+=createRow(t,e),e++;main.innerHTML=o,setTimeout((()=>{a(n+1)}),8e3)};a(0)};fetch("assets/data.json").then((t=>t.json())).then((t=>{renderItems(t)}));